ing; // topRight; topLeft; bottomRight; bottomLeft\n      offsetX?: number;\n      offsetY?: number\n    };\n    custom?(options: any): void;\n  }\n  \n  export interface MSXAxis {\n    type?: 'category' | 'datetime' | 'numeric';\n    categories?: string[] | number[];\n    labels?: {\n      show?: boolean;\n      rotate?: number;\n      rotateAlways?: boolean;\n      hideOverlappingLabels?: boolean;\n      showDuplicates?: boolean;\n      trim?: boolean;\n      minHeight?: number;\n      maxHeight?: number;\n      style?: {\n        colors?: string[];\n        fontSize?: string;\n        fontFamily?: string;\n        cssClass?: string;\n      };\n      offsetX?: number;\n      offsetY?: number;\n      format?: string;\n      datetimeFormatter?: {\n        year?: string;\n        month?: string;\n        day?: string;\n        hour?: string;\n        minute?: string;\n      };\n      formatter?(value: string, timestamp: number): string;\n    };\n    axisBorder?: {\n      show?: boolean;\n      color?: string;\n      offsetX?: number;\n      offsetY?: number;\n      strokeWidth?: number;\n    };\n    axisTicks?: {\n      show?: boolean;\n      borderType?: string;\n      color?: string;\n      height?: number;\n      offsetX?: number;\n      offsetY?: number;\n    };\n    tickAmount?: number;\n    min?: number;\n    max?: number;\n    range?: number;\n    floating?: boolean;\n    position?: string;\n    title?: {\n      text?: string;\n      offsetX?: number;\n      offsetY?: number;\n      style?: {\n        color?: string;\n        fontFamily?: string;\n        fontSize?: string;\n        cssClass?: string;\n      };\n    };\n    crosshairs?: {\n      show?: boolean;\n      width?: number | string;\n      position?: string;\n      opacity?: number;\n      stroke?: {\n        color?: string;\n        width?: number;\n        dashArray?: number;\n      };\n      fill?: {\n        type?: string;\n        color?: string;\n        gradient?: {\n          colorFrom?: string;\n          colorTo?: string;\n          stops?: number[];\n          opacityFrom?: number;\n          opacityTo?: number;\n        };\n      };\n      dropShadow?: {\n        enabled?: boolean;\n        top?: number;\n        left?: number;\n        blur?: number;\n        opacity?: number;\n      };\n    };\n    tooltip?: {\n      enabled?: boolean;\n      offsetY?: number;\n      formatter?(value: string, opts: object): string;\n      style?: {\n        fontSize?: string,\n        fontFamily?: string\n      }\n    };\n  }\n  \n  export interface MSYAxis {\n    show?: boolean;\n    showAlways?: boolean;\n    seriesName?: string;\n    opposite?: boolean;\n    logarithmic?: boolean;\n    tickAmount?: number;\n    forceNiceScale?: boolean,\n    min?: number;\n    max?: number;\n    floating?: boolean;\n    decimalsInFloat?: number;\n    labels?: {\n      show?: boolean;\n      minWidth?: number;\n      maxWidth?: number;\n      offsetX?: number;\n      offsetY?: number;\n      rotate?: number;\n      align?: 'left' | 'center' | 'right';\n      padding?: number,\n      style?: {\n        color?: string;\n        fontSize?: string;\n        fontFamily?: string;\n        cssClass?: string;\n      };\n      formatter?(val: number, opts?: any): string;\n    };\n    axisBorder?: {\n      show?: boolean;\n      color?: string;\n      offsetX?: number;\n      offsetY?: number\n    };\n    axisTicks?: {\n      show?: boolean;\n      color?: string;\n      width?: number;\n      offsetX?: number;\n      offsetY?: number\n    };\n    title?: {\n      text?: string;\n      rotate?: number;\n      offsetX?: number;\n      offsetY?: number;\n      style?: {\n        color?: string;\n        fontSize?: string;\n        fontFamily?: string;\n        cssClass?: string;\n      };\n    };\n    crosshairs?: {\n      show?: boolean;\n      position?: string;\n      stroke?: {\n        color?: string;\n        width?: number;\n        dashArray?: number\n      };\n    };\n    tooltip?: {\n      enabled?: boolean;\n      offsetX?: number;\n    };\n  }\n  \n  export interface MSGrid {\n    show?: boolean;\n    borderColor?: string;\n    strokeDashArray?: number;\n    position?: 'front' | 'back';\n    xaxis?: {\n      lines?: {\n        show?: boolean;\n        offsetX?: number;\n        offsetY?: number;\n      }\n    };\n    yaxis?: {\n      lines?: {\n        show?: boolean;\n        offsetX?: number;\n        offsetY?: number;\n      }\n    };\n    row?: {\n      colors?: string[];\n      opacity?: number\n    };\n    column?: {\n      colors?: string[];\n      opacity?: number;\n    };\n    padding?: {\n      top?: number;\n      right?: number;\n      bottom?: number;\n      left?: number;\n    };\n  }\n  \n  export interface MSTheme {\n    mode?: 'light' | 'dark';\n    palette?: string;\n    monochrome?: {\n      enabled?: boolean,\n      color?: string;\n      shadeTo?: 'light' | 'dark';\n      shadeIntensity?: number\n    };\n  }\n  \n  interface MSDiscretePoint {\n    seriesIndex?: number;\n    dataPointIndex?: number;\n    fillColor?: string;\n    strokeColor?: string;\n    size?: number;\n  }\n  \n  export interface MSMarkers {\n    size?: number;\n    colors?: string[];\n    strokeColor?: string | string[];\n    strokeWidth?: number | number[];\n    strokeOpacity?: number | number[];\n    fillOpacity?: number | number[];\n    discrete?: MSDiscretePoint[];\n    shape?: 'circle' | 'square' | string[];\n    radius?: number;\n    offsetX?: number;\n    offsetY?: number;\n    onClick?(e: any): void;\n    onDblClick?(e: any): void;\n    hover?: {\n      size?: number;\n      sizeOffset?: number;\n    };\n  }\n  \n  \n  export interface MSNoData {\n    text?: string,\n    align?: 'left' | 'right' | 'center',\n    verticalAlign?: 'top' | 'middle' | 'bottom',\n    offsetX?: number,\n    offsetY?: number,\n    style?: {\n      color?: string,\n      fontSize?: string,\n      fontFamily?: string\n    }\n  }\n  \n  export type ChartType = 'line' | 